import React from 'react'
import { Link } from 'react-router-dom'

const NoteItem = ({ note }) => {
  return (
    <Link className='note_item' to={`/note/${note.id}`}>
      <h3 >{note.body}</h3>
      <h3 >{(Date.parse(note.updated_at)).toLocaleDateString()}</h3>

    </Link>
  )
}

export default NoteItem
